  [],\n\t\"revision_timestamp\": \"2016-08-04T08:18:48.727902\",\n\t\"name\": \"togiak-national-wildlife-refuge-annual-narrative-report-calendar-year-1996\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Togiak
  NWR outlines Refuge accomplishments during the 1996 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands and fire
  management. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, scientific collections, animal control, and marking
  and bird banding. The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
  observation, outdoor recreation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment replacement, communication systems, computer systems,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end. Refuge brochures are attached.\",\n\t\"license_title\": \"License Not
